import React from 'react';
import icone from '../../styles/images/icone.png';
import 'primereact/resources/themes/saga-blue/theme.css';
import 'primereact/resources/primereact.min.css';
import '../../styles/css/layout.css';
import { BiLogOutCircle } from 'react-icons/bi/index';
import { Typography } from 'antd';

const { Text } = Typography

const style = {
    main: {
        height: '100%',
        width: '100%',
        background: '#fff',
        display: 'flex',
        flexDirection: 'column'
    },
    navbar: {
        height: '7%',
        width: '100%',
        display: 'flex',
        background: 'linear-gradient(90deg, rgb(255, 119, 59) 0%, rgb(255, 142, 36) 35%, rgb(255, 84, 67) 100%)',
        alignItems: 'center',
        justifyContent: 'space-between',
        maxHeight: '53px',
        minHeight: '53px'
    },
    sidebar:{
        height:'100%',
        width:'10%',
        background:'#ff7b38'
    }
}

const Layout = (props) => {
    return (
        <main style={style.main}>
                <div style={{ marginRight: '10px', display:'flex', alignItems:'center'}}>
                    <Text style={{ color: '#fff', marginRight:'10px', cursor:'pointer' }} strong >Admin</Text>
                    <BiLogOutCircle style={{ fontSize: '25px', cursor: 'pointer' }} />
                </div>
            <div style={style.sidebar}>

            </div>
        </main>
    )
}

export default Layout;
